Description:
11.7 The condensate drain line to the water heater and furnace/heat pump is not insulated in the garage - see attached video for a detailed description. Note that the condensate drain lines exist in an unconditioned/unheated space which means, they are susceptible to freezing/breakages. If the drain lines freeze, it will cause the water heater/heat system to malfunction;
Recommend the builder to install insulation around condensate drain lines to prevent future freezing, breakages/water heater/
heat system malfunction.

The condensate drain line to the water heater is not insulated - see attached video for a detailed description. If the drain line freezes, it will cause the water heater to malfunction; 

Please install insulation around condensate drain line to prevent future freezing, breakages/water heater malfunction.

Condensate drain lines are not insulated per standard and are not required to be insulated per code.  No warranty action necessary.

The furnace is stored within a closet in the garage and this room is not insulated/heated – technically a cold room. Note that the cold air return duct is not insulated and neither is the condensate drain line. Missing insulation around the cold air return duct will decrease the energy efficiency of the system. Furthermore, the condensate drain line is susceptible to freezing, backing up and malfunctioning the heat system; 

Please install the insulation around condensate drain line and also wrap the cold air return duct with insulation to avoid damage in winters. 

There is no warranty provision for this.  Homeowner may choose to add additional insulation if desired.  No warranty action necessary.
